social_posts.post_text:
It’s always nice catching up with my fellow cannabis industry peeps. Parties are finally coming back in full swing and I couldn’t be more excited to be connecting with everyone again. 

Thank you @allay_consulting, and @grasslandsagency for hosting such an awesome event and for letting me join. ❤️

@thekimstuck and @bruvs thank you for being so great at bringing people together!! 🙌

4 years ago on a Friday the 13th we went to see @alisonwonderland at Red Rocks and that night Anson told me he loved me and we decided to be together. In one year from today, again on a Friday the 13th, I get to call him my husband 🥰

@anson.mitchell thank you for loving all of me and for supporting me and my dreams. Now let’s go build our empire 🙌🏰 I love you more than I can put in to words ❤️ #anniversary #lovestory #loveisintheair #boobear #fridaythe13th #luckylady #iloveyou

📸: @beclouisemay @joseanmartinezsantiago
